ture: POB Screen UI verification and Complete Testing\n\n  @OnboardingVerification\n  Scenario Outline: Meter UI and button clicks verifications on POB Screen\n    Given Meter Alerts comes as Driver move to the POB screen\n    When Verify Cost value and text on POB screen\n    And check distance \"<distance>\" text on POB screen\n    And check to verify miles covered values and text on POB screen\n    And Check Progress loader icon on POB screen\n    And check pob lable \"<waiting>\" text\n    And Check pob time value\n    And click on Meter expand button on pob to see meter details\n    And check tariff \"<tariff>\" text on POB screen\n    And check pob screen tariff value \"<tariffvalue>\" text\n    And Check meter pob \"<waitlabel>\" text\n    And check meter pob value\n    And Check meter extra \"<extra>\" text on pob screen\n    And check meter extra value on pob\n    And Check meter discount percentage \"<discountper>\" text on pob screen\n    And check meter discount percentage value on pob screen\n    And Check stop waiting \"<stopwaiting>\" text on pob screen\n    And click on Stop waiting button on pob screen\n    And Check Start waiting \"<startwaiting>\" text on pob screen\n    And click on Start waiting button again on pob screen\n    And Check to verify stop meter \"<stopmeter>\" text on pob screen\n    And click on Stop meter button on pob screen\n    And check to verify Start meter \"<startmeter>\" text on pob screen\n    And click on Start meter button on pob screen\n    And check to verify Add extra charges \"<addextracharges>\" on pob screen\n    And Verify customer image on pob screen\n    And verify customer name on pob screen\n    And message chat icon on pob screen\n    And click again on Meter expand button to close meter details on pob screen\n    Then Meter UI texts and buttons clicks are verified on pob screen\n\n    Examples: \n      | distance | waiting | tariff | tariffvalue | waitlabel | extra | discountper         | stopwaiting  | startwaiting  | stopmeter  | startmeter  | addextracharges   |\n      | Distance | Waiting | Tariff | T1          | Waiting   | Extra | Discount Percentage | Stop Waiting | Stop Waiting | Stop Meter | Start Meter | Add extra charges |\n\n  @OnboardingVerification\n  Scenario Outline: POB Screens UI and buttons clicks verifications\n    When Driver is on POB Screen and lets verify Waiting screens UI and texts fields\n    And move scroll up so that pick and drop address and screen UI are visible on pob screen\n    And verify pob screen current location icon\n    And verify pob screen start navigation icon\n    And verify pob screen pickup whole box\n    And verify pob screen dropoff whole box\n    And Check pob screen pickup zone text\n    And Check pob screen pickup address text\n    And check pob screen dropoff zone text\n    And check pob screen dropoff Address text\n    And check change dropoff address \"<dropoffaddress>\" text on pob screen\n    And check pob screen jobtype text\n    And check pob screen payment text\n    And check pob screen Booking text\n    And check pob screen tariff text\n    And check pob screen driver notes text\n    And check stc button \"<stc>\" text\n    And move scroll down so that pick and drop address and screen UI are not visible on pob screen\n    Then POB Job screen UI elements are verified\n\n    Examples: \n      | stc   | dropoffaddress |\n      | S.T.C | Change         |\n\n  @Onboarding\n  Scenario Outline: To Move job to the STC status as driver tab on stc button when driver is on board\n    When Driver Click on stc button\n    Then Job Status become STC\n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///Users/mac/git/DM8_Automation/Infocabs-DM8-Android-IOS-Automation/src/test/resources/Featuresfiles/09_JobPOB_Screen.feature","feature":{"location":{"line":1,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"POB Screen UI verification and Complete Testing","description":"","childre ss \"<dropoffaddress>\" text on stc screen\n    And check stc screen jobtype text\n    And check stc screen payment text\n    And check stc screen Booking text\n    And check stc screen tariff text\n    And check stc screen driver notes text\n    And check Clear button \"<clear>\" text\n    And move scroll down so that pick and drop address and screen UI are not visible on stc screen\n    Then STC Job screen UI elements are verified\n\n    Examples: \n      | clear | dropoffaddress |\n      | Clear | Change         |\n\n  @Onboarding\n  Scenario Outline: To move Job to Feedback screen and Job status become completed as driver click on clear button\n    When Driver Click on clear button\n    Then Driver move to the Feedback screen\n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///Users/mac/git/DM8_Automation/Infocabs-DM8-Android-IOS-Automation/src/test/resources/Featuresfiles/10_JobSTC_Screen.feature","feature":{"location":{"line":1,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"STC Screen UI verification and Complete Testing","description":"","children":[{"scenario":{"location":{"line":4,"column":3},"tags":[{"location":{"line":3,"column":3},"name":"@OnboardingVerification","id":"e8079829-124f-4463-a39d-4e45d24d696d"}],"keyword":"Scenario Outline","name":"Meter UI and button clicks verifications on STC Screen","description":"","steps":[{"location":{"line":5,"column":5},"keyword":"Given ","keywordType":"Context","text":"Meter Alerts comes as Driver move to the STC screen","id":"209ddd90-e280-4c0b-96c7-373b8b009ca6"},{"location":{"line":6,"column":5},"keyword":"When ","keywordType":"Action","text":"Verify Cost value and text on STC screen","id":"27d05655-427a-487a-8059-9b8738884cc2"},{"location":{"line":7,"column":5},"keyword":"And ","keywordType":"Conjunction","text":"check distance \"<distance>\" text on STC screen","id":"1a904c2d-2dcb-4ee6-895c-a610d508d3e2"},{"location":{"line":8,"column":5},"keyword":"And ","key ted in order to check and verify Drivers Messages in throughout job status\n\n  @OnboardingDriversMessages\n  Scenario Outline: Drivers Messages verification on Accepted screen\n    Given Job has been received on DM8 and Accept it for Drivers Messages verifications\n    When click on message icon chat button on Accepted screen\n    And check Message whole alerts on Accepted screen\n    And check alerttitle \"<msg>\" text on Accepted screen\n    And click message chat icon button for second time on Accepted screen\n    And chech to verify message area on Accepted screen\n    And check to verify cancle \"<cnle>\" button text Accepted screen\n    And check to verify send \"<send>\" button text on Accepted screen\n    And click message chat icon to send message on Accepted screen\n    And click on message button on Accepted screen\n    And click on send button button on Accepted screen\n    And click on move job to waiting status for Chat message verification\n    Then All UI and text are verified on Accepted screen\n\n    Examples: \n      | msg      | cnle   | send |\n      | Messages | CANCEL | SEND |\n\n  @OnboardingDriversMessages\n  Scenario Outline: Drivers Messages verification on Waiting screen\n    Given Job are in waiting status\n    When click on message icon chat button on Waiting screen\n    And check Message whole alerts on Waiting screen\n    And check alerttitle \"<msg>\" text on Waiting screen\n    And click message chat icon button for second time on Waiting screen\n    And chech to verify message area on Waiting screen\n    And check to verify cancle \"<cnle>\" button text Waiting screen\n    And check to verify send \"<send>\" button text on Waiting screen\n    And click message chat icon to send message on Waiting screen\n    And click on message button on Waiting screen\n    And click on send button button on Waiting screen\n    And click on move job to pob status for Chat message verification\n    Then All UI and text are verified on Waiting screen\n\n    Examples: \n      | msg      | cnle   | send |\n      | Messages | CANCEL | SEND |\n\n  @OnboardingDriversMessages\n  Scenario Outline: Drivers Messages verification on POB screen\n    Given Job are in pob status\n    When click on message icon chat button on POB screen\n    And check Message whole alerts on POB screen\n    And check alerttitle \"<msg>\" text on POB screen\n    And click message chat icon button for second time on POB screen\n    And chech to verify message area on POB screen\n    And check to verify cancle \"<cnle>\" button text POB screen\n    And check to verify send \"<send>\" button text on POB screen\n    And click message chat icon to send message on POB screen\n    And click on message button on POB screen\n    And click on send button button on POB screen\n    And click on move job to stc status for Chat message verification\n    Then All UI and text are verified on POB screen\n\n    Examples: \n      | msg      | cnle   | send |\n      | Messages | CANCEL | SEND |\n\n  @OnboardingDriversMessages\n  Scenario Outline: Drivers Messages verification on STC screen\n    Given Job are in stc status\n    When click on message icon chat button on STC screen\n    And check Message whole alerts on STC screen\n    And check alerttitle \"<msg>\" text on STC screen\n    And click message chat icon button for second time on STC screen\n    And chech to verify message area on STC screen\n    And check to verify cancle \"<cnle>\" button text STC screen\n    And check to verify send \"<send>\" button text on STC screen\n    And click message chat icon to send message on STC screen\n    And click on message button on STC screen\n    And click on send button button on STC screen\n    And click on move job to clear status for Chat message verification\n    Then All UI and text are verified on STC screen\n\n    Examples: \n      | msg      | cnle   | send |\n      | Messages | CANCEL | SEND |\n\n  #@OnboardingDriversMessages\n  #Scenario Outline: Drivers Messages verification on Clear screen\n    #Given Job are in clear status\n    #When click on message icon chat button on Clear screen\n    #And check Message whole alerts on Clear screen\n    #And check alerttitle \"<msg>\" text on Clear screen\n    #And click message chat icon button for second time on Clear screen\n    #And chech to verify message area on Clear screen\n    #And check to verify cancle \"<cnle>\" button text Clear screen\n    #And check to verify send \"<send>\" button text on Clear screen\n    #And click message chat icon to send message on Clear screen\n    #And click on message button on Clear screen\n    #And click on send button button on Clear screen\n    #And click on move job to Feedback status for Chat message verification\n    #Then All UI and text are verified on Clear screen\n\n    #Examples: \n     # | msg      | cnle   | send |\n      #| Messages | CANCEL | SEND |\n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///Users/mac/git/DM8_Automation/Infocabs-DM8-Android-IOS-Automation/src/test/resources/Featuresfiles/15_DriverMessages.feature","feature":{"location":{"line":1,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"Verify Drivers Messages Alert functionality on All Job Status","description":"","children":[{"scenario":{"location":{"line":4,"column":3},"tags":[{"location":{"line":3,"column":3},"name":"@OnboardingDriversMessages","id":"c89321f0-e96c-4820-8c0a-66bd6fb084c6"}],"keyword":"Scenario Outline","name":"Job creation from Evop for Drivers messages verification on All Job Status","description":"","steps":[{"location":{"line":5,"column":5},"keyword":"Given ","keywordType":"Context","text":"Job request are given for Drivers Messages alert verification","id":"a77aa95d-d394-49f8-bb14-70e10570db4c"},{"location":{"line":6,"column":5},"keyword":"When ","keywordType":"Action","text":"Job request are send to the server for Drivers messages verification","id":"169d5972-cecc-4c26-aa6b-5c1 ing screen\n    And click on POB button to move to pob status for Map navigation on Waiting screen\n    Then Map Navigations all UI elments are verified on Waiting screen\n\n    Examples: \n      | distance | waiting |\n      | Distance | Waiting |\n\n  @OnboardingDriversMessages\n  Scenario Outline: Map Navigation verification on POB screen\n    Given Job are in pob status for Map Navigation verifications\n    When click on Map navigation button on POB screen\n    #And Verify Cost value and text for Map navigation on POB screen\n    #And check distance \"<distance>\" text for Map navigation on POB screen\n    #And check to verify miles covered values and text for Map navigation on POB screen\n    #And check waiting lable \"<waiting>\" text for Map navigation on POB screen\n    #And Check waiting time value for Map navigation on POB screen\n    And click on Back button to bring App back on screen for Map navigation on POB screen\n    And click on STC button to move to stc status for Map navigation on POB screen\n    Then Map Navigations all UI elments are verified on POB screen\n\n    Examples: \n      | distance | waiting |\n      | Distance | Waiting |\n\n  @OnboardingDriversMessages\n  Scenario Outline: Map Navigation verification on STC screen\n    Given Job are in STC status for Map Navigation verifications\n    When click on Map navigation button on STC screen\n    #And Verify Cost value and text for Map navigation on STC screen\n    #And check distance \"<distance>\" text for Map navigation on STC screen\n    #And check to verify miles covered values and text for Map navigation on STC screen\n    #And check waiting lable \"<waiting>\" text for Map navigation on STC screen\n    #And Check waiting time value for Map navigation on STC screen\n    And click on Back button to bring App back on screen for Map navigation on STC screen\n    And click on Clear button to move to Feedback screen so that all status are verified\n    Then Map Navigations all UI elments ar ate back to to home screen\n\n    Examples: \n      | alert1  | details                                               | no | yes |\n      | No Show | Do you really want to send No-Show and clear the job? | NO | YES |\n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///Users/mac/git/DM8_Automation/Infocabs-DM8-Android-IOS-Automation/src/test/resources/Featuresfiles/17_SendSMSRingBackSendNoShow.feature","feature":{"location":{"line":1,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"Verify On Send SMS Ring back and Send No Show on Job Waiting status","description":"","children":[{"scenario":{"location":{"line":4,"column":3},"tags":[{"location":{"line":3,"column":3},"name":"@OnboardingSendSMSRingBackSendNoShow","id":"3c40254f-13df-41a0-9614-1546bcf0be7c"}],"keyword":"Scenario Outline","name":"Job creation from Evop for verification of Send SMS Ring back and Send No Show on Job Waiting status","description":"","steps":[{"location":{"line":5,"column":5},"keyword":"Given ","keywordType":"Context","text":"Job request are given for Send SMS Ring back and Send No Show on Job Waiting status verification","id":"b2721a6e-d13b-4d53-a452-ba551f50037d"},{"location":{"line":6,"column":5},"keyword":"When ","keywordType":"Action","text":"Job request are send to the server for Send SMS Ring back and Send No Show on Job Waiting status verification","id":"82abfc80-d4b3-4eb6-8036-15c3e823f35f"},{"location":{"line":7,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"new job has been created in order to check and verify Send SMS Ring back and Send No Show on Job Waiting status","id":"ae4d574a-80fe-43b7-bc58-09df7b0cdcd9"}],"examples":[],"id":"3cf0b2a4-7cdd-419e-bd3f-b0f9dd2ae6f1"}},{"scenario":{"location":{"line":10,"column":3},"tags":[{"location":{"line":9,"column":3},"name":"@OnboardingSendSMSRingBack","id":"991689b5-4e15-4812-abc9-0d06b0ee669a"}],"keyword":"Scenario Outline","name":"Send SMS Ring back verification on Waiting s etried":false}},{"source":{"uri":"file:///Users/mac/git/DM8_Automation/Infocabs-DM8-Android-IOS-Automation/src/test/resources/Featuresfiles/18_BackChangeAndAddExtracharges.feature","data":"Feature: Verify Go back and Change dropoff address and Add Extra charges verification on Job flow\n\n  @OnboardingGobackChangeDropoffAddextra\n  Scenario Outline: Create a job from evop to verify Goback and change dropoff address and Add extra charges\n    Given Job request are given for Goback and change dropoff address and Add extra charges verification\n    When Job request are send to the server for Goback and change dropoff address and Add extra charges verification\n    Then new job has been created in order to check and verify Goback and Change dropoff and extra charges\n\n  @OnboardingGoback\n  Scenario Outline: Go back button functionality verification on Job status\n    Given Job has been received on DM8 and Accept and move to STC status to verify Go back in all job status\n    When scroll up the screen so that Go back button are visible\n    And check that Driver are in STC status by verifying clear \"<clr>\" button text\n    And Click on Back button on STC status\n    And check to verify driver get back to POB status by verifying stc \"<stc>\" button text\n    And click on Go back button POB status\n    And check to verify driver get back to Waiting status by verifying pob \"<pob>\" button text\n    And click on Back button on waiting status\n    And check to verify driver get back to Accepted status by verifying waiting \"<wait>\" button text\n    Then Go back button are verified in all job status\n\n    Examples: \n      | clr   | stc   | pob   | wait    |\n      | Clear | S.T.C | P.O.B | Waiting |\n\n  @OnboardingChangeDropoff\n  Scenario Outline: Change dropoff Address functionality verification on Job status\n    Given Job Status should be in POB by verifying stc \"<stc>\" to check for ChangeDropoff address\n    When Click on Change dropoff address button\n    And check to verify Change Address whole alert\n    And check to verify Change Address title \"<titile>\" text\n    And check to verify change address Alert messages dialog\n    And check verify cancel \"<cnl>\" button text on change address dialog\n    And check to verify update \"<update>\" text on change address dialog\n    And click on first address to change dropoff zone address\n    And click on Update button to update the address on POB status\n    And now move job to STC status to check address change again\n    And click on change address button on STC status\n    And click on address zone on STC status\n    And click on Update button on STC status\n    Then Change address is properly working and address zone can be changed easily\n\n    Examples: \n      | stc   | titile        | cnl    | update |\n      | S.T.C | Dropoff Zones | CANCEL | UPDATE |\n\n  @OnboardingAddExtra\n  Scenario Outline: Verify Add Extra Charges on Job status\n    Given Job Status should be in POB by verifying stc \"<stc>\" to check for Adding extra charges\n    When Scroll screen so that Add extra button should be clickable\n    And click on Add Extra button on POB status\n    And check to verify whole Extra Alert on POB status\n    And check to verify title \"<extratitle>\" text on Add Extra alert\n    And check whole message area on Add Extra alert\n    And check cancle \"<cnl>\" text on Add extra alert\n    And check ok \"<ok>\" text on Add extra alert\n    And click to Enter \"<pound>\" pound extra value\n    And click on OK button to add Extra charges\n    And move job to STC screen to add Extra charges\n    And click on Add Extra button STC screen\n    And click to Add \"<pound>\" more extra pounds on STC screen\n    And agin click on OK button to add more Extra on STC screen\n    And click to Clear and submit feedback of job with Extra value added\n    Then Adding Extra charges can be added easily on both POB and STC Job status\n\n    Examples: \n      | stc   | extratitle                 | cnl    | ok | pound |\n      | S.T.C | Please enter extra amount: | CANCEL | OK |    10 |\n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///Users/mac/git/DM8_Automation/Infocabs-DM8-Android-IOS-Automation/src/test/resources/Featuresfiles/18_BackChangeAndAddExtracharges.feature","feature":{"location":{"line":1,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"Verify Go back and Change dropoff address and Add Extra charges verification on Job flow","description":"","children":[{"scenario":{"location":{"line":4,"column":3},"tags":[{"location":{"line":3,"column":3},"name":"@OnboardingGobackChangeDropoffAddextra","id":"9772cd05-3bb5-490d-8ea9-da82915734a3"}],"keyword":"Scenario Outline","name":"Create a job from evop to verify Goback and change dropoff address and Add extra charges","description":"","steps":[{"location":{"line":5,"column":5},"keyword":"Given ","keywordType":"Context","text":"Job request are given for Goback and change dropoff address and Add extra charges verification","id":"3b6290c0-1348-4908-a598-4a6c3bd2f2a9"},{"location":{"line":6,"column":5},"keyword":"When ","keywordType":"Action","text":"Job request are send to the server for Goback and change dropoff address and Add extra charges verification","id":"9ad762d0-2a13-4339-93ba-7303ae8c0b0b"},{"location":{"line":7,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"new job has been created in order to check and verify Goback and Change dropoff and extra charges","id":"8ef0e972-3d80-4a99-a135-5fc4684f7f16"}],"examples":[],"id":"b694c8ce-fe1e-40d5-a9a5-71a31ab81199"}},{"scenario":{"location":{"line":10,"column":3},"tags":[{"location":{"line":9,"column":3},"name":"@OnboardingGoback","id":"601a583e-441f-47fe-aa43-d6608d90215c"}],"keyword":"Scenario Outline","name":"Go back button functionality verification on Job status","description":"","steps":[{"location":{"line":11,"column":5},"keyword":"Given ","keywordType":"Context","text":"Job
